import React from 'react';
import Container from 'react-bootstrap/Container';


function Skills(){
    return(
        <div>
            <h5 className = "font-weight-bolder">Here Are Some Of My Skills</h5>

            <Container fluid = {true} className = "margins">
                <h6 className="d-inline p-1 mr-4 bg-dark text-white">Python</h6>
                <h6 className="d-inline p-1 mr-4 bg-dark text-white" >C/C++</h6>
                <h6 className="d-inline p-1 mr-4 bg-dark text-white" >Java</h6>
                <h6 className="d-inline p-1 mr-4 bg-dark text-white" >Swift</h6>
            </Container>


        </div>
    );
}

export default Skills;
